  <div>
  <h1>Give us your Feedback!</h1>
  <Button 
  onClick = {() => setGood(good++)} 
  text = 'Good'
  />
  <Button 
  onClick = {() => setNeutral(neutral++)} 
  text = 'Neutral'
  />
